\\"AnswerContent\\\":\\\"The six - week course is cheaper if you also do the one-day class. (true)\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"The one- day class is free for those who book the six-week course. \\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"You must pay for the six-week course before you do the one- day class.\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":null,\"CreatorId\":1,\"TestCategoryId\":9,\"AnswerList\":[{\"AnswerContent\":\"You must pay for the six-week course before you do the one- day class.\",\"IsCorrect\":false},{\"AnswerContent\":\"The six - week course is cheaper if you also do the one-day class. (true)\",\"IsCorrect\":true},{\"AnswerContent\":\"The one- day class is free for those who book the six-week course. \",\"IsCorrect\":false}],\"Id\":1,\"Active\":true,\"UpdatedTime\":\"2020-09-11T16:51:20\",\"CreatedTime\":null}]},\"ReadingPartThrees\":{\"TestCategory\":{\"TypeCode\":\"READING\",\"PartId\":3,\"Name\":\"Cliff Jones\",\"Description\":null,\"WYSIWYGContent\":\"<p style=\\\"text-align:center\\\"><span style=\\\"font-size:13pt\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\"><strong><span style=\\\"font-size:14.0pt\\\">Cliff Jones</span></strong></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:13pt\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\"><img alt=\\\"Image result for cliff jones&quot;\\\" src=\\\"data:image/jpeg;base64,\\\" style=\\\"float:right; height:225px; width:193px\\\" /><span style=\\\"font-size:14.0pt\\\">In 2005, <span style=\\\"color:#00b050\\\">Cliff Jones began a journey round Britain on a unicycle, a bike with only one wheel</span>. <span style=\\\"color:#00b050\\\">He had already made a documentary film about his experiences travelling round Europe in a 50-year-old car</span>. He was mad about motor sport and had a job building racing car engines. <span style=\\\"color:#00b050\\\">To save money, Cliff rode to work in London on an old bicycle</span>, which he also used to go to France on holiday. &lsquo;<span style=\\\"color:#00b050\\\">That trip opened my eyes,</span>&#39; he says. <span style=\\\"color:#00b050\\\">&lsquo;I decided to do a tour of Britain by bike.&rsquo;</span></span></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:13pt\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\"><span style=\\\"font-size:14.0pt\\\">Cliff didn&rsquo;t want a normal touring bike, and he knew he wanted to build one himself. &lsquo;The craziest bicycle I could think of was a unicycle, so I went to a factory to see how they are made.&rsquo; <span style=\\\"color:#00b050\\\">After one false start in 2004, when he had to tum back because of a knee injury, he finally set out in 2005.</span> He was away for four months, and travelled over 8,500 km. </span></span></span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:14.0pt\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">The best bit of the trip was arriving in Wales and seeing Mount Snowdon. &#39;Although <span style=\\\"color:#00b050\\\">I met cyclists who could easily ride up mountains on their bikes</span>, which I couldn&rsquo;t do, <span style=\\\"color:#00b050\\\">I never regretted my unicycle</span>. The further away from London I got, the more amazed people seemed by it. His <span style=\\\"color:#00b050\\\">worst moment </span>came when he had to drink some dirty water from a stream. <span style=\\\"color:#00b050\\\">A serious fever kept him in bed in hospital for five long days.</span> He was determined not to give up and go back home before he had completed his challenge, but found it hard to carry on because he felt so weak. Yet despite all this, Cliff now says, &#39;If I could afford it, <span style=\\\"color:#00b050\\\">I would like to do something similar again</span>.&rsquo;</span></span></p>\\r\\n\",\"CreatorId\":0,\"Id\":21,\"Active\