est.\",\"IsCorrect\":false},{\"AnswerContent\":\"He took too long to get to one place.\",\"IsCorrect\":false},{\"AnswerContent\":\"He fell ill for nearly a week.  (true)\",\"IsCorrect\":true}],\"Id\":15,\"Active\":true,\"UpdatedTime\":\"2020-09-11T16:51:57.731045\",\"CreatedTime\":null},{\"QuestionText\":\"When Cliff met other cyclists in the mountains, he was\",\"QuestionImage\":\"\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"anxious to get away from them.\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"satisfied with his own type of bicycle.  (true)\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"jealous of what they were able to do.\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"surprised by their attitude towards him.\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":null,\"CreatorId\":1,\"TestCategoryId\":21,\"AnswerList\":[{\"AnswerContent\":\"satisfied with his own type of bicycle.  (true)\",\"IsCorrect\":true},{\"AnswerContent\":\"jealous of what they were able to do.\",\"IsCorrect\":false},{\"AnswerContent\":\"surprised by their attitude towards him.\",\"IsCorrect\":false},{\"AnswerContent\":\"anxious to get away from them.\",\"IsCorrect\":false}],\"Id\":14,\"Active\":true,\"UpdatedTime\":\"2020-09-11T16:51:57.727752\",\"CreatedTime\":null}]},\"ReadingPartFours\":{\"TestCategory\":{\"TypeCode\":\"READING\",\"PartId\":4,\"Name\":\"Alpacas\",\"Description\":null,\"WYSIWYGContent\":\"<p style=\\\"text-align:center\\\"><span style=\\\"font-size:13pt\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\"><strong><span style=\\\"font-size:14.0pt\\\">Alpacas</span></strong></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:13pt\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\"><span style=\\\"font-size:14.0pt\\\">Alpacas were first (0) ............ by the Inca people in the mountains of South America, more than six thousand years ago. These animals (<stro