4:58.503532\"}]},{\"TestCategory\":{\"WritingPartTwos\":[],\"SpeakingEmbeds\":[],\"TypeCode\":\"LISTENING\",\"PartId\":1,\"Name\":\"Pet2T3.6\",\"Description\":\"Nghe, nhìn tranh\",\"WYSIWYGContent\":null,\"CreatorId\":1,\"Id\":135,\"Active\":true,\"UpdatedTime\":\"2020-09-20T16:20:11.672629\",\"CreatedTime\":\"2020-09-20T16:20:11.672612\"},\"ListeningMedia\":{\"Audio\":\"\\\\uploads\\\\listening\\\\part_1\\\\audio\\\\3DA4A1064512893EE4D39AFF6E0797182CD7737233238698D829F2F1CDE3DB64_1e22.mp3\",\"Transcript\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Which picture does the woman decide to send?</span></strong></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Woman</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: My mother wants me to send her a photo of our new house. Which one shall I send?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Man</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: This one is nice, with the children playing in the back garden.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Woman</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: <span style=\\\"color:red\\\">I prefer this one with you standing by the front door</span><u>.</u></span></span></span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:16px\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Man</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: <span style=\\\"color:red\\\">Well, send her that one then</span>.</span></span></p>\\r\\n\",\"TestCategoryId\":135,\"Id\":73,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:20:11.688525\",\"CreatedTime\":\"2020-09-20T09:20:11.688525\"},\"ListeningBaseQuestions\":[{\"QuestionText\":\"Which picture does the woman decide to send?\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\52C8C5840860DD47892B023963290D3CF2F0298D3ECA087F75E1180A97B77E8E_9ab7.png\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\E0718660EFB254AA7D9F078C7EA8FCCD8CE3E1492D93D3D5A1984579C49B67EF_fda4.png\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\AB135618EA09C18095DD6BA13C188398B83A76F14F9C76BDB1D238561EB4B9F6_c694.png\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":135,\"AnswerList\":[{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\AB135618EA09C18095DD6BA13C188398B83A76F14F9C76BDB1D238561EB4B9F6_c694.png\",\"IsCorrect\":false},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\E0718660EFB254AA7D9F078C7EA8FCCD8CE3E1492D93D3D5A1984579C49B67EF_fda4.png\",\"IsCorrect\":false},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\52C8C5840860DD47892B023963290D3CF2F0298D3ECA087F75E1180A97B77E8E_9ab7.png\",\"IsCorrect\":true}],\"Id\":89,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:20:11.696205\",\"CreatedTime\":\"2020-09-20T09:20:11.696205\"}]},{\"TestCategory\":{\"WritingPartTwos\":[],\"SpeakingEmbeds\":[],\"TypeCode\":\"LISTENING\",\"PartId\":1,\"Name\":\"Pet1T2.6\",\"Description\":\"Nghe, nhìn tranh\",\"WYSIWYGContent\":null,\"CreatorId\":1,\"Id\":53,\"Active\":true,\"UpdatedTime\":\"2020-09-15T15:00:13.083469\",\"CreatedTime\":\"2020-09-15T15:00:13.083453\"},\"ListeningMedia\":{\"Audio\":\"\\\\uploads\\\\listening\\\\part_1\\\\audio\\\\FDB27BEA6B7D38A56161779A168732DF175A646421C518EAF19548428DA63F4F_4083.mp3\",\"Transcript\":\"<p><span style=\\\"font-size:14px\\\"><strong>What time is the swimming lesson today?</strong> </span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>Girl</strong>: Hi Judy - do you want to play tennis after school - say about 4.30? </span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>Judy</strong>: Mmm - that would be fun but I&rsquo;ve got a swimming lesson. It&rsquo;s usually at a quarter past five but it&rsquo;s half an hour earlier this evening, <span style=\\\"color:#e74c3c\\\">at a quarter to five</span>. It takes me ages to cycle to the swimming pool, so I really don&rsquo;t think I&rsquo;ll have time today - let&rsquo;s try tomorrow. </span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\"><strong>Girl</strong>: OK!</span></p>\\r\\n\",\"TestCategoryId\":53,\"Id\":27,\"Active\":true,\"UpdatedTime\":\"2020-09-15T08:00:13.120994\",\"CreatedTime\":\"2020-09-15T08:00:13.120993\"},\"ListeningBaseQuestions\":[{\"QuestionText\":\"What time is the swimming lesson today?\",\"Hint\":\"at a quarter to five\",\"Answers\":\"[{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\3178639EA84C763B83818ABC05F325FBF8D99FF4136618E4C5CB8F9E0D727AC5_42c7.png\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\51607D515E0A197F86EE932E3A170DA8C0EC2863BAF7F930DBCBBF38E8811A1D_eb9e.png\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\CE7242109B29EE757CF0C79E05BFB8E4AFFDB3886AB726C4B56AF231C9B07083_fd9e.png\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":53,\"AnswerList\":[{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\51607D515E0A197F86EE932E3A170DA8C0EC2863BAF7F930DBCBBF38E8811A1D_eb9e.png\",\"IsCorrect\":true},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\CE7242109B29EE757CF0C79E05BFB8E4AFFDB3886AB726C4B56AF231C9B07083_fd9e.png\",\"IsCorrect\":false},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\3178639EA84C763B83818ABC05F325FBF8D99FF4136618E4C5CB8F9E0D727AC5_42c7.png\",\"IsCorrect\":false}],\"Id\":43,\"Active\":true,\"UpdatedTime\":\"2020-09-15T08:00:13.129812\",\"CreatedTime\":\"2020-09-15T08:00:13.12981\"}]}],\"ListeningPartTwos\":[{\"TestCategory\":{\"WritingPartTwos\":[],\"SpeakingEmbeds\":[],\"TypeCode\":\"LISTENING\",\"PartId\":2,\"Name\":\"Pet1T1\",\"Description\":\"Listening, part 2\",\"WYSIWYGContent\":null,\"CreatorId\":1,\"Id\":147,\"Active\":true,\"UpdatedTime\":\"2020-09-20T16:44:39.168989\",\"CreatedTime\":\"2020-09-20T16:44:39.168983\"},\"ListeningMedia\":{\"Audio\":\"\\\\uploads\\\\listening\\\\part_2\\\\audio\\\\8AA794DBF3C4FBAF1330CAF4C1E6230E7BB5620B00FE0F44B57E2B756CBCEEA2_fb47.mp3\",\"Transcript\":\"<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">You will hear an interview with a singer called Nick Parker who plays in a band called Krispy with his sister Mel.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">For each question, choose the correct answer, A, B or C.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">You now have 45 seconds to look at the questions for Part 2.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">[Pause]</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Now we are ready to start. Listen carefully. You will hear the recording twice.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: I&rsquo;m talking to Nick Parker, the singer with the band called Krispy. Nick your sister, Mel, plays guitar in the band too, doesn&rsquo;t she?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Yeah. Mel&rsquo;s a year younger than me. We&#39;ve been playing and singing together since we were &hellip; eight, nine. <span style=\\\"color:red\\\">Dad is a guitarist and took us to hear the great bands playing live (8)</span>. Mel and I put on shows at school, which was a lot of fun. Mum thought we were good, but she didn&rsquo;t want us to get too serious about our music because of the hard lives professional musicians have.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: When did you start writing music?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: I&rsquo;ve been writing since I was ten. And later Mel started working with me. <span style=\\\"color:red\\\">We didn&rsquo;t have the same influences (9)</span> - I liked rock music and she loved world music, especially bands from Africa. But we found good ways of mixing the styles.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Your band, Krispy, has two guys and two girls in it. How was it formed?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Mel and I were playing in a concert at our college and there were two students from music school in the audience. <span style=\\\"color:red\\\">They came to see us after the show and asked if we&rsquo;d like to form a band with them</span> <span style=\\\"color:red\\\">(10)</span>. We weren&rsquo;t sure at first because we were much younger than them. But we agreed to try it out, and it was brilliant.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Was the band an immediate success?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Well, we spent the first year practising and writing music. During that time we all had studying to do. <span style=\\\"color:red\\\">We played in local concerts, and the audiences enjoyed what we did. (11)</span> Then during one holiday we recorded two songs and sent them to a music company. They offered us a contract, but our parents said we had to finish college first.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: You&rsquo;ve been together a few years now and you&rsquo;re one of the top bands. What&rsquo;s that like?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Hard work. We travel to concerts all round the world and are never in one place for more than a few nights. <span style=\\\"color:red\\\">The others are like an older brother and sister to me and Mel,</span> <span style=\\\"color:red\\\">which is good</span>. <span style=\\\"color:red\\\">They help us relax on our days off, and make sure we eat well. They&rsquo;re strict about practising too. (12)</span></span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Have you had any disappointments?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Everything we&rsquo;ve recorded has done well. Three singles have gone to number one, and our first album has sold over a million copies. Our second album was due out this winter, <span style=\\\"color:red\\\">but I&rsquo;ve been ill recently so we&rsquo;ve started recording late, which is a pity (13)</span>. But for the rest, everything&rsquo;s fine.</span></span></p>\\r\\n\",\"TestCategoryId\":147,\"Id\":82,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.187421\",\"CreatedTime\":\"2020-09-20T09:44:39.18742\"},\"ListeningBaseQuestions\":[{\"QuestionText\":\"When Nick and Mel were younger,\",\"Hint\":null,\"Answers\":\"\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":null,\"Id\":98,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.200007\",\"CreatedTime\":\"2020-09-20T09:44:39.200007\"},{\"QuestionText\":\"9. When Nick and Mel started writing music together, they\",\"Hint\":null,\"Answers\":\"\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":null,\"Id\":99,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.205188\",\"CreatedTime\":\"2020-09-20T09:44:39.205188\"},{\"QuestionText\":\"10. The band Krispy was started after\",\"Hint\":null,\"Answers\":\"\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":null,\"Id\":100,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.208397\",\"CreatedTime\":\"2020-09-20T09:44:39.208396\"},{\"QuestionText\":\"11. In the band’s first year together,\",\"Hint\":null,\"Answers\":\"\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":null,\"Id\":101,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.211638\",\"CreatedTime\":\"2020-09-20T09:44:39.211638\"},{\"QuestionText\":\"12. What does Nick say about life in the band today?\",\"Hint\":null,\"Answers\":\"\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":null,\"Id\":102,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.214669\",\"CreatedTime\":\"2020-09-20T09:44:39.214669\"},{\"QuestionText\":\"13. What disappointment has the band had?\",\"Hint\":null,\"Answers\":\"\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":null,\"Id\":103,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.217943\",\"CreatedTime\":\"2020-09-20T09:44:39.217942\"}]}]}',0,-1,1,NULL),(142,1,'2020-09-20 13:19:09.175733','2020-09-20 13:19:09.175690','LISTENING',-1,'','{\"ListeningPartOnes\":[{\"TestCategory\":{\"WritingPartTwos\":[],\"SpeakingEmbeds\":[],\"TypeCode\":\"LISTENING\",\"PartId\":1,\"Name\":\"Pet2T2.2\",\"Description\":\"Nghe, nhìn tranh\",\"WYSIWYGContent\":null,\"CreatorId\":1,\"Id\":111,\"Active\":true,\"UpdatedTime\":\"2020-09-20T10:14:43.519961\",\"CreatedTime\":\"2020-09-20T10:14:43.519943\"},\"ListeningMedia\":{\"Audio\":\"\\\\uploads\\\\listening\\\\part_1\\\\audio\\\\70312C4E6802B6B2CE0E59