edTime\":\"2020-09-14T22:25:39.65053\"},\"ListeningMedia\":{\"Audio\":\"\\\\uploads\\\\listening\\\\part_1\\\\audio\\\\A4731D812DC0D11B33CBE98AD330FBA9823F3EB93580581125872070077ADBE5_0ff5.mp3\",\"Transcript\":\"<p><span style=\\\"font-size:14px\\\">Kimberley: Hi, it&rsquo;s Kimberley. I got your message and I&rsquo;d love to go to the movies. There&rsquo;s a film called Spy Game, or a comedy - I don&rsquo;t mind which&hellip; Shall we meet outside the cinema?</span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">Girl: Or, I know, <span style=\\\"color:#e74c3c\\\">at the burger bar on the corner</span>. We could have a snack before we go in or we could meet at the bus station.</span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">Kimberley: Mum&rsquo;s driving me into town this afternoon, to buy some trainers, so I won&rsquo;t be near the station. <span style=\\\"color:#e74c3c\\\">But something to eat first is a good idea</span>. Shall we say 6 o&rsquo;clock?</span></p>\\r\\n\\r\\n<p><span style=\\\"font-size:14px\\\">Girl: OK.</span></p>\\r\\n\",\"TestCategoryId\":44,\"Id\":19,\"Active\":true,\"UpdatedTime\":\"2020-09-14T15:25:39.687883\",\"CreatedTime\":\"2020-09-14T15:25:39.687881\"},\"ListeningBaseQuestions\":[{\"QuestionText\":\"Where will the friends meet?\",\"Hint\":\"at the burger bar on the corner, But something to eat first is a good idea\",\"Answers\":\"[{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\CA34F9B5A8C2D938312207FF6EBE57D51AF600D07CEAB6570AF150ACE913E5FD_1cbe.png\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\104840DAE4222F5AB1C073C8CAED189E3AB02072A5302562CA8B43BF9DFBA4E7_5150.png\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\3DFB5BAF9F8C2FB768409E63E3F9AB7B805E5E769B8F80B673F87992650C57F4_eda0.png\\\",\\\"IsCorrect\\\":false}]\",\"Ex