an</strong>: Oh, no.</span></p>\\r\\n\",\"TestCategoryId\":113,\"Id\":57,\"Active\":true,\"UpdatedTime\":\"2020-09-20T03:17:48.355474\",\"CreatedTime\":\"2020-09-20T03:17:48.355474\"},\"ListeningBaseQuestions\":[{\"QuestionText\":null,\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\5F0196330C0943FD73A656F617D691DC04ACA2B9B12F5EF6B1B4F066C7E5BF85_96b0.png\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\192256256B436093C19C7E06C2236CBC9A5E15B85A64C7C6C61437D9AF7498BA_51d7.png\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\64C1160A464D160BD5CAA29FF58A51CA8EC8589E2819C6A30ABAD03B15890F7A_b5c8.png\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":113,\"AnswerList\":[{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\64C1160A464D160BD5CAA29FF58A51CA8EC8589E2819C6A30ABAD03B15890F7A_b5c8.png\",\"IsCorrect\":false},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\5F0196330C0943FD73A656F617D691DC04ACA2B9B12F5EF6B1B4F066C7E5BF85_96b0.png\",\"IsCorrect\":true},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\192256256B436093C19C7E06C2236CBC9A5E15B85A64C7C6C61437D9AF7498BA_51d7.png\",\"IsCorrect\":false}],\"Id\":73,\"Active\":true,\"UpdatedTime\":\"2020-09-20T03:17:48.36349\",\"CreatedTime\":\"2020-09-20T03:17:48.363489\"}]},{\"TestCategory\":{\"WritingPartTwos\":[],\"SpeakingEmbeds\":[],\"TypeCode\":\"LISTENING\",\"PartId\":1,\"Name\":\"Pet1T4.2\",\"Description\":\"Nghe, nhìn tranh\",\"WYSIWYGContent\":null,\"CreatorId\":1,\"Id\":124,\"Active\":true,\"UpdatedTime\":\"2020-09-20T16:01:04.372419\",\"CreatedTime\":\"2020-09-20T16:01:04.372395\"},\"ListeningMedia\":{\"Audio\":\"\\\\uploads\\\\listening\\\\part_1\\\\audio\\\\FA7D682C77BBEF2CABA3C8629376F2790EE51A17429E3CAB1CEC109C76423237_40a7.mp3\",\"Transcript\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>Which postcard will they send?</strong></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>Girl</strong>: We mustn&rsquo;t forget to send Mum a postcard&hellip; how about this one with a picture of the mountain?</span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>Boy</strong>: Well, it&rsquo;s nice but we can&rsquo;t actually see it from where we&rsquo;re staying. <span style=\\\"color:red\\\">What about a view of the lake and the village instead</span>? Or perhaps one of the garden pictures if you think she&rsquo;d prefer it. Look at the cottage and all the flowers&hellip;</span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>Girl</strong>: Mmm&hellip; <span style=\\\"color:red\\\">I think your first idea was better</span>&hellip; we could put a cross to show where we&rsquo;re staying.</span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><strong><span style=\\\"font-family:&quot;Calibri&quot;,sans-serif\\\">Boy</span></strong><span style=\\\"font-family:&quot;Calibri&quot;,sans-serif\\\">: Right then, let&rsquo;s do that.</span></span></p>\\r\\n\",\"TestCategoryId\":124,\"Id\":62,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:01:04.399283\",\"CreatedTime\":\"2020-09-20T09:01:04.399282\"},\"ListeningBaseQuestions\":[{\"QuestionText\":\"Which postcard will they send?\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\97CBCFD5B36B4BAD36D136C6B5E18D455D9A26EB32189F8759223C0B411A855E_2291.png\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\30B88C6AC361742FC343AD50AFFC0466ABF7B5C6728828F17332838359B15AD2_18b8.png\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"\\\\\\\\uploads\\\\\\\\listening\\\\\\\\part_1\\\\\\\\images\\\\\\\\A56002D4CD295EA654140371FA2AA9A5564CA16C59318EA959B041AB4C06224B_cae5.png\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":124,\"AnswerList\":[{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\97CBCFD5B36B4BAD36D136C6B5E18D455D9A26EB32189F8759223C0B411A855E_2291.png\",\"IsCorrect\":true},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\A56002D4CD295EA654140371FA2AA9A5564CA16C59318EA959B041AB4C06224B_cae5.png\",\"IsCorrect\":false},{\"AnswerContent\":\"\\\\uploads\\\\listening\\\\part_1\\\\images\\\\30B88C6AC361742FC343AD50AFFC0466ABF7B5C6728828F17332838359B15AD2_18b8.png\",\"IsCorrect\":false}],\"Id\":78,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:01:04.407336\",\"CreatedTime\":\"2020-09-20T09:01:04.407336\"}]}],\"ListeningPartTwos\":[{\"TestCategory\":{\"WritingPartTwos\":[],\"SpeakingEmbeds\":[],\"TypeCode\":\"LISTENING\",\"PartId\":2,\"Name\":\"Pet1T1\",\"Description\":\"Listening, part 2\",\"WYSIWYGContent\":null,\"CreatorId\":1,\"Id\":147,\"Active\":true,\"UpdatedTime\":\"2020-09-20T21:06:08.722094\",\"CreatedTime\":\"2020-09-20T16:44:39\"},\"ListeningMedia\":{\"Audio\":\"\\\\uploads\\\\listening\\\\part_2\\\\audio\\\\8AA794DBF3C4FBAF1330CAF4C1E6230E7BB5620B00FE0F44B57E2B756CBCEEA2_fb47.mp3\",\"Transcript\":\"<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">You will hear an interview with a singer called Nick Parker who plays in a band called Krispy with his sister Mel.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">For each question, choose the correct answer, A, B or C.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">You now have 45 seconds to look at the questions for Part 2.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">[Pause]</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Now we are ready to start. Listen carefully. You will hear the recording twice.</span></em></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: I&rsquo;m talking to Nick Parker, the singer with the band called Krispy. Nick your sister, Mel, plays guitar in the band too, doesn&rsquo;t she?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Yeah. Mel&rsquo;s a year younger than me. We&#39;ve been playing and singing together since we were &hellip; eight, nine. <span style=\\\"color:red\\\">Dad is a guitarist and took us to hear the great bands playing live (8)</span>. Mel and I put on shows at school, which was a lot of fun. Mum thought we were good, but she didn&rsquo;t want us to get too serious about our music because of the hard lives professional musicians have.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: When did you start writing music?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: I&rsquo;ve been writing since I was ten. And later Mel started working with me. <span style=\\\"color:red\\\">We didn&rsquo;t have the same influences (9)</span> - I liked rock music and she loved world music, especially bands from Africa. But we found good ways of mixing the styles.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Your band, Krispy, has two guys and two girls in it. How was it formed?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Mel and I were playing in a concert at our college and there were two students from music school in the audience. <span style=\\\"color:red\\\">They came to see us after the show and asked if we&rsquo;d like to form a band with them</span> <span style=\\\"color:red\\\">(10)</span>. We weren&rsquo;t sure at first because we were much younger than them. But we agreed to try it out, and it was brilliant.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Was the band an immediate success?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Well, we spent the first year practising and writing music. During that time we all had studying to do. <span style=\\\"color:red\\\">We played in local concerts, and the audiences enjoyed what we did. (11)</span> Then during one holiday we recorded two songs and sent them to a music company. They offered us a contract, but our parents said we had to finish college first.</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: You&rsquo;ve been together a few years now and you&rsquo;re one of the top bands. What&rsquo;s that like?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Hard work. We travel to concerts all round the world and are never in one place for more than a few nights. <span style=\\\"color:red\\\">The others are like an older brother and sister to me and Mel,</span> <span style=\\\"color:red\\\">which is good</span>. <span style=\\\"color:red\\\">They help us relax on our days off, and make sure we eat well. They&rsquo;re strict about practising too. (12)</span></span></span></span></p>\\r\\n\\r\\n<p style=\\\"margin-right:21px; text-align:justify\\\"><span style=\\\"font-size:16px\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Int</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Have you had any disappointments?</span></span></span></p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:16px\\\"><strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">Nick</span></strong><span style=\\\"font-family:&quot;Times New Roman&quot;,serif\\\">: Everything we&rsquo;ve recorded has done well. Three singles have gone to number one, and our first album has sold over a million copies. Our second album was due out this winter, <span style=\\\"color:red\\\">but I&rsquo;ve been ill recently so we&rsquo;ve started recording late, which is a pity (13)</span>. But for the rest, everything&rsquo;s fine.</span></span></p>\\r\\n\",\"TestCategoryId\":147,\"Id\":82,\"Active\":true,\"UpdatedTime\":\"2020-09-20T09:44:39.187421\",\"CreatedTime\":\"2020-09-20T09:44:39.18742\"},\"ListeningBaseQuestions\":[{\"QuestionText\":\"When Nick and Mel were younger,\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"A\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"B\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"C\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":[{\"AnswerContent\":\"C\",\"IsCorrect\":false},{\"AnswerContent\":\"A\",\"IsCorrect\":false},{\"AnswerContent\":\"B\",\"IsCorrect\":true}],\"Id\":98,\"Active\":true,\"UpdatedTime\":\"2020-09-20T14:06:09.087407\",\"CreatedTime\":\"2020-09-20T09:44:39\"},{\"QuestionText\":\"When Nick and Mel started writing music together, they\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"A\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"B\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"C\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":[{\"AnswerContent\":\"C\",\"IsCorrect\":false},{\"AnswerContent\":\"A\",\"IsCorrect\":false},{\"AnswerContent\":\"B\",\"IsCorrect\":true}],\"Id\":99,\"Active\":true,\"UpdatedTime\":\"2020-09-20T14:06:09.449023\",\"CreatedTime\":\"2020-09-20T09:44:39\"},{\"QuestionText\":\"The band Krispy was started after\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"A\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"B\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"C\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":[{\"AnswerContent\":\"B\",\"IsCorrect\":true},{\"AnswerContent\":\"C\",\"IsCorrect\":false},{\"AnswerContent\":\"A\",\"IsCorrect\":false}],\"Id\":100,\"Active\":true,\"UpdatedTime\":\"2020-09-20T14:06:09.841425\",\"CreatedTime\":\"2020-09-20T09:44:39\"},{\"QuestionText\":\"In the band’s first year together,\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"A\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"B\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"C\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":[{\"AnswerContent\":\"A\",\"IsCorrect\":false},{\"AnswerContent\":\"B\",\"IsCorrect\":true},{\"AnswerContent\":\"C\",\"IsCorrect\":false}],\"Id\":101,\"Active\":true,\"UpdatedTime\":\"2020-09-20T14:06:10.204618\",\"CreatedTime\":\"2020-09-20T09:44:39\"},{\"QuestionText\":\"What does Nick say about life in the band today?\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"A\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"B\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"C\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":[{\"AnswerContent\":\"C\",\"IsCorrect\":false},{\"AnswerContent\":\"B\",\"IsCorrect\":true},{\"AnswerContent\":\"A\",\"IsCorrect\":false}],\"Id\":102,\"Active\":true,\"UpdatedTime\":\"2020-09-20T14:06:10.558975\",\"CreatedTime\":\"2020-09-20T09:44:39\"},{\"QuestionText\":\"What disappointment has the band had?\",\"Hint\":null,\"Answers\":\"[{\\\"AnswerContent\\\":\\\"A\\\",\\\"IsCorrect\\\":false},{\\\"AnswerContent\\\":\\\"B\\\",\\\"IsCorrect\\\":true},{\\\"AnswerContent\\\":\\\"C\\\",\\\"IsCorrect\\\":false}]\",\"ExplainLink\":\"\",\"CreatorId\":1,\"TestCategoryId\":147,\"AnswerList\":[{\"AnswerContent\":\"C\",\"IsCorrect\":false},{\"AnswerContent\":\"A\",\"IsCorrect\":false},{\"AnswerContent\":\"B\",\"IsCorrect\":true}],\"Id\":103,\"Active\":true,\"UpdatedTime\":\"2020-09-20T14:06:10.912859\",\"CreatedTime\":\"2020-09-20T09:44:39\"}]}]}',0,-1,1,NULL);
